INSERT INTO `catalog_product_entity_text` VALUES (1,4,72,0,1,'<div class=\"col-xs-6 col-sm-6 col-lg-6\">\r\n<h4>Specifications</h4>\r\n<br /> Size and Weight<br /> 5.75 x 2.83 x 0.30 inches<br /> 5.36 ounce<br /> Connectivity<br /> Sync methods: 802.11a/b/g/n/ac, Wi-Fi<br /> 4G Capable<br /> 4G LTE Capable<br /> Wi-Fi Calling<br /> Operating System and Processor<br /> Android 4.4<br /> 2.5GHz Quad core application processor<br /> Memory<br /> 3GB RAM, 32GB ROM (user memory)<br /> Battery Life<br /> Up to 21 hours talk time<br /> Up to 21 days standby time<br /> Camera<br /> 20.7 Megapixel Camera<br /> Front-facing Camera<br /> Office Hub<br /> GPS <br /> GPS enabled<br /> International<br /> Quad Band GSM; LTE: 2, 4; UMTS: Band I (2100), Band II (1900), Band IV (1700/2100), Band V (850), Band VIII (900)<br /> Hearing Aid Compatibility<br /> M3 &amp; T3<br /> Alerts</div>\r\n<div class=\"col-xs-6 col-sm-6 col-lg-6\">\r\n<h4>In The Box</h4>\r\n<br /> Size and Weight<br /> 5.75 x 2.83 x 0.30 inches<br /> 5.36 ounce<br /> Connectivity<br /> Sync methods: 802.11a/b/g/n/ac, Wi-Fi<br /> 4G Capable<br /> 4G LTE Capable<br /> Wi-Fi Calling<br /> Operating Syste</div>'),(2,4,73,0,1,'\"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\"'),(3,4,83,0,1,NULL),(4,4,106,0,1,NULL),(7,4,72,0,2,'<div class=\"col-xs-6 col-sm-6 col-lg-6\">\r\n<h4>Specifications</h4>\r\n<br /> Size and Weight<br /> 5.75 x 2.83 x 0.30 inches<br /> 5.36 ounce<br /> Connectivity<br /> Sync methods: 802.11a/b/g/n/ac, Wi-Fi<br /> 4G Capable<br /> 4G LTE Capable<br /> Wi-Fi Calling<br /> Operating System and Processor<br /> Android 4.4<br /> 2.5GHz Quad core application processor<br /> Memory<br /> 3GB RAM, 32GB ROM (user memory)<br /> Battery Life<br /> Up to 21 hours talk time<br /> Up to 21 days standby time<br /> Camera<br /> 20.7 Megapixel Camera<br /> Front-facing Camera<br /> Office Hub<br /> GPS <br /> GPS enabled<br /> International<br /> Quad Band GSM; LTE: 2, 4; UMTS: Band I (2100), Band II (1900), Band IV (1700/2100), Band V (850), Band VIII (900)<br /> Hearing Aid Compatibility<br /> M3 &amp; T3<br /> Alerts</div>\r\n<div class=\"col-xs-6 col-sm-6 col-lg-6\">\r\n<h4>In The Box</h4>\r\nSize<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4.84&rdquo; x 2.36 x 0.45&rdquo;<br /><br />Weight<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4.1 oz<br /><br />Operating System<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Android 2.3 Gingerbread<br /><br />Display<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2.8\" Touch Screen, QWERTY<br /><br />Talk Time<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5.4 hrs<br /><br />Processor<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 600 MHz<br /><br />Camera<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2.0 MP<br /><br />Memory<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Internal 130 MB</div>'),(8,4,73,0,2,'Meet the Samsung Replenish™\r\n\r\n The first eco-friendly Android™ powered phone. What makes it green: Made from 82% recyclable materials and boxed in fully recyclable packaging. What makes it awesome: Powered by the seamless Android 2.2 platform and features like GPS, Wi-Fi and a full QWERTY keyboard'),(9,4,83,0,2,NULL),(10,4,106,0,2,NULL),(15,4,72,0,3,'<p><strong><span style=\"font-size: medium;\">Overview</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: #ffffff; line-height: 23.799999237060547px; color: #666666; font-family: Raleway, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: 500; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;\">The&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">Kyocera Rise</strong>&nbsp;is a versatile Android device, free from contracts and at an affordable price point.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: #ffffff; line-height: 23.799999237060547px; color: #666666; font-family: Raleway, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: 500; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;\">With a 3.5-inch touchscreen and slide-out QWERTY keyboard, the Rise caters to your preference. Running Android 4 (Ice Cream Sandwich), the Rise boasts features such as a 3.2 MP camera with LED flash and video capture, stereo Bluetooth, Wi-Fi connectivity, and more.</p>\r\n<p>&nbsp;</p>\r\n<h4 style=\"margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-color: #ffffff; color: #333333; line-height: 1em; font-weight: 500; font-family: Raleway, Arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;\">Key Features</h4>\r\n<p>&nbsp;</p>\r\n<ul style=\"margin: 0px; padding: 0px 0px 23px 16px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: #ffffff; list-style: disc; line-height: 26px; color: #666666; font-family: Raleway, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: 500; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;\">\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">Android 4.0 OS (Ice Cream Sandwich)</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">3.5-inch HVGA IPS Display</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">QWERTY Keyboard</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">3.2 MP Camera, LED Flash, and Video Capture</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; background-position: initial initial; background-repeat: initial initial;\">Wi-Fi 802.11 b/g/n</li>\r\n<li style=\"margin: 0px; padding: 0px; border: 0px; outl