 On-the-go pros whose need for connectivity takes them well beyond the confines of their office &ndash; meeting with clients, jobsite visits or on a company retreat. With the capability to extend the experience to any Wi-Fi enabled device and share the connection securely with others, you&rsquo;ll be the hottest spot around!</p>\r\n<p style=\"margin: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: #ffffff; line-height: 23.799999237060547px; color: #666666; font-family: Raleway, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: 500; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; font-weight: bold; background-position: initial initial; background-repeat: initial initial;\">Work smarter:</strong>&nbsp;Stay connected, virtually anywhere. When traveling overseas, maintain productivity when you stay connected using an unlocked SIM designed for international travel. The powerful 2500 mAh battery will keep you connected for up to 10 hours of continuous use on a single charge, making it perfect for travelling or on the go. The intuitive LCD touchscreen allows you to monitor data usage, administer networks, or manage security settings in the palm of your hand.</p>\r\n<h3 style=\"margin: 0px; padding: 0px 0px 10px; border: 0px; outline: 0px; font-size: 22px; vertical-align: baseline; background-color: #ffffff; color: #333333; line-height: 1em; font-weight: 500; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: